import React from 'react';
import { NavLink } from 'react-router-dom';
import Result from '../pages/Result';
import Ajout
 from '../pages/Ajout';
const Navigation = () => {
    return (
        
        <div className="Navigation">
            <ul>
                <NavLink to="/">
                    <li>Accueil</li>
                </NavLink>
                <NavLink to="/Ajout">
                <button type="button" className="btn btn-outline-primary">Ajout de these</button>
                </NavLink>
                <NavLink to="/Result">
                    <li>Resultat</li>
                </NavLink>
            </ul>
        </div>
    );
};

export default Navigation;
